import React from "react";
import HighStock from "highcharts/highstock";
import HighchartsReact from "highcharts-react-official";

const StockGraph = (props) => {
  if (props.data.length === 0) {
    return <div>Enter Something</div>;
  }
  console.log(props.data);
  let groupingUnits = [
    [
      "week", // unit name
      [1], // allowed multiples
    ],
    ["month", [1, 2, 3, 4, 6]],
  ];

  let options = {
    rangeSelector: {
      selected: 1,
    },

    title: {
      text: "AAPL Historical",
    },

    yAxis: [
      {
        labels: {
          align: "right",
          x: -3,
        },
        title: {
          text: "OHLC",
        },
        height: "60%",
        lineWidth: 2,
        resize: {
          enabled: true,
        },
      },
      {
        labels: {
          align: "right",
          x: -3,
        },
        title: {
          text: "Volume",
        },
        top: "65%",
        height: "35%",
        offset: 0,
        lineWidth: 2,
      },
    ],

    tooltip: {
      split: true,
    },

    series: [
      {
        type: "candlestick",
        name: "AAPL",
        data: [],
        dataGrouping: {
          units: groupingUnits,
        },
      },
      {
        type: "column",
        name: "Volume",
        data: [],
        yAxis: 1,
        dataGrouping: {
          units: groupingUnits,
        },
      },
    ],
  };
  const dataLength = props.data.length;
  for (var i = 0; i < dataLength; i += 1) {
    options.series[0].data.push([
      props.data[i][0], // the date
      parseInt(props.data[i][1]), // open
      props.data[i][2], // high
      props.data[i][3], // low
      props.data[i][4], // close
    ]);

    options.series[1].data.push([
      props.data[i][0], // the date
      props.data[i][5], // the volume
    ]);
  }

  return (
    <div className="App">
      <HighchartsReact
        highcharts={HighStock}
        constructorType={"stockChart"}
        options={options}
      />
    </div>
  );
};

export default StockGraph;
